import React from "react";
import { Route, Switch } from "react-router-dom";
import "./styles/App.css";
import NotFound from "./page/NotFound";
import Cv_Home from "./page/Home_Cv";
import Contact_CV from "./page/Contact_CV";
import Portfolio from "./page/Portfolio";
import Knowledge from "./page/Knowledge";
// import Login from "./components/connexion/Login";
// import Singup from "./components/connexion/SingUp";
// import { PrivateRoute } from "./components/PrivateRoute/PrivateRoute";

function App() {
  return (
    <>
      <Switch>
        {/* <Route exact path="/login" component={Login} />
        <Route exact path="/singup" component={Singup} /> */}
        <Route exact path="/" component={Cv_Home} />
        <Route exact path="/contact_cv" component={Contact_CV} />
        <Route exact path="/portfolio" component={Portfolio} />
        <Route exact path="/presence" component={Knowledge} />
        <Route component={NotFound} />
      </Switch>
    </>
  );
}
export default App;
